import React, { Component } from 'react'

export class Footer extends Component {
  static propTypes = {}

  render() {
    return (
        <>
            <div class="container my-5">
            <section
             class="d-flex justify-content-between p-4 text-white"
             style="background-color: #21D192"
             >
                </section>
                
            </div>
        </>
    )
  }
}

export default Footer
